import React, { Component } from 'react';
import beerService from './services/beerService';

class App extends Component {
  render() {
    const getBeers = async () => {
      let res = await beerService.getData();
      console.log(res);
    }
    return <div>Here I am lets gooooooo</div>
  }
}

export default App;
